INSERT INTO `v1_c95fb89c350d89fcc786f5a5e7b1450a8b09510ea78bd4b6a24d7d91bd513cf3` VALUES (/*1e2cb59a637e7459134190913a2cca4fafa1b9b84869819190c1aa660e4075b8*/1002901, /*304aee7c7423dffd7d4c355a716ded1aca87c54d35101fe2644e5053238a8b85*/"ボム", /*d90541b2e7116387d1bd78c8d801aad1cd50c859742703d5dfe69e150c171d6d*/1, /*ef1d107e11611cefe8a362e148d69d4cc512095ea83f5abda79003dda66d4acc*/10029, /*7c55de334a2a2673b98eaf6a9d0737574393b9342176962be5f1d9c19a023f07*/"「ばくだん」の英語読み。", /*e4b53f24de0e1f6ce2fa260d9ff93bd2b8761426b3c75fb7b77b9fb43291b2e4*/1);
